import React from 'react';
import Sidebar from './components/Sidebar';
//scss
import '../style/sass/components/base.scss'

class WebPlayerNew extends React.Component{
  render(){
    return(
      <div className="webplayer">
        <Sidebar/>
      </div>
    )
  }
}
export default WebPlayerNew;
